import React from 'react'
import WinsByColorGraph from './WinsByColorGraph';

function Graphs({ chessgames }) {
  return (
    <>
        <div>Graphs</div>
        <div>{chessgames.length}</div>
        <WinsByColorGraph chessgames={chessgames}/>
    </>
  )
}

export default Graphs;
